import { Item } from '../types/Item';

export const items: Item[] = [
    { date: new Date(2022, 4, 28), category: 'food', title: 'McDonalds', value: 69.12 },
    { date: new Date(2022, 4, 28), category: 'fuel', title: 'Gasolina', value: 120.00 },
    { date: new Date(2022, 4, 30), category: 'rent', title: 'Aluguel', value: 1200.00 },
    { date: new Date(2022, 4, 31), category: 'salary', title: 'Salário Mês', value: 6000.00 },
    { date: new Date(2022, 5, 11), category: 'salary', title: 'Adiantamento', value: 2400.00 },

];
